        <style type="text/css">
            .tagEdit {
                padding-bottom: 4px;
                padding-top: 4px;
            }

            .edit-tag {
                width: 155px;margin-left: 10px;
            }

            .list-tags {
                white-space: nowrap;
                padding: 1px 0px 0px 0px;
            }

            #suggest-table {
                display: none;
                position: absolute;
                z-index: 2;
                background-color: #fff;
                border: 1px solid #9ac;
            }

            #suggest-table tr td {
                color: #333;
                font: 11px Verdana, sans-serif;
                padding: 2px;
            }

            #suggest-table tr.hovered {
                color: #efedd4;
                background-color: #9ac;
            }


            .see-popular {
                padding: 1.3em 0 0 0;
            }

            .tag-cols {
                border-collapse: collapse;
            }

            .tag-cols td {
                vertical-align: top;
                width: 250px;
                padding-right: 30px;
            }

            .tag-cols .tag-row {
                padding: 0 0 7px 0px;
            }

            .tag-cols .see-all {
                white-space: nowrap;
                padding-top: 5px;
            }

            .tags-piles-feedback {
                display: none;
                color: #000;
                font-size: 0.9em;
                font-weight: bold;
                margin: 0px 0 0 0;
            }

            .tag-cols i {
                display: none;
                cursor: pointer;
                cursor: hand;
                float: left;
                font-style: normal;
                font-size: 0px;
                vertical-align: bottom;
                width: 16px;
                height: 16px;
                margin-top: 1px;
                margin-right: 3px;
            }

